import React from 'react';
import { Link } from 'react-router-dom';
import { API } from '../../../utils/config';

const Card = ({ job }) => {
    return (
        <div className="col-md-4 col-sm-4 col-xs-12">
            <div className="card">
                <div className="card-body">
                    <div style={{ minHeight: "3em" }}>
                        <h5 class="card-title">{job.title}</h5>
                    </div>
                    <p><b>Requires Skills:</b> {job.required_skills}</p>
                    <p><b>Application Starting Time:</b> {job.application_start_time}</p>
                    <p><b>Application Ending Time:</b> {job.application_ending_date}</p>
                    <p><b>Possible Job Starting Time:</b> {job.starting_date}</p>
                    <Link to={`${API}/`}>
                        <button className="btn btn-outline-warning btn-sm">Apply Now</button>
                    </Link>
                </div>
            </div>
        </div>
    )
}

export default Card;
